import React, {useState} from 'react'
// import {Route} from 'react-router-dom'
// import Home from './Home'
import {useNavigate} from 'react-router-dom'
import * as yup from 'yup';


function SignUp({handleSignupClick, onLogin}) {

    const [session, setSession] = useState(false)
    const [username, setUsername] = useState("")
    const [password, setPassword] = useState("")
    const [email, setEmail] = useState("")
    const [phone, setPhone] = useState(null)
    const [age, setAge] = useState(null)
    const navigate = useNavigate()
    const [errors, setErrors] = useState({});



    const validationSchema = yup.object().shape({
        username: yup.string().required('Username is required'),
        password: yup
          .string()
          .required('Password is required')
          .min(8, 'Password must be 8 characters long')
          .matches(/[0-9]/, 'Password requires a number')
          .matches(/[a-z]/, 'Password requires a lowercase letter')
          .matches(/[A-Z]/, 'Password requires an uppercase letter')
          .matches(/[^\w]/, 'Password requires a symbol'),
        email: yup.string().email('Invalid email').required('Email is required'),
        phone: yup.string().required('Phone number is required'),
        age: yup.number().required('Age is required').positive('Age must be a positive number').integer('Age must be an integer'),
      });



    if (session === false){

    const user = {
      username: username,
      password: password,
      email: email,
      phone: phone,
      age: age
    }

    const handleSubmit = (e) => {
      e.preventDefault()

      validationSchema.validate(
        {
          username,
          password,
          email,
          phone,
          age,
        },
        { abortEarly: false }
      )
      .then(() => {
        // form is valid, submit it or do something else
      })
      .catch((err) => {
        // form is invalid, set the validation errors
        const validationErrors = {};
        err.inner.forEach((error) => {
          validationErrors[error.path] = error.message;
        });
        setErrors(validationErrors);
      });
      fetch("/signup", {
        method: "POST",
        headers: {"Content-Type": "application/json"},
        body: JSON.stringify(user)
      })
      .then(r => {
        if (r.ok){
          r.json()
          .then( console.log('success'))
          setSession(!session)
          onLogin(user)
          navigate('/')
        } else {
          console.log('failure')
        }
      })
        e.target.reset()
    }

    const setSignupState = (e) => {
        handleSignupClick(e)
    }

    return (
      <div>
      <div class="ui center aligned huge header" style={{margin:40}}>Welcome !</div>
      <div className="new-user-form">
        <div class="ui sizer vertical segment">
          <h2 class="ui center aligned large header" >Create a New Account</h2>
        </div>
        <form class='ui form' onSubmit={handleSubmit}>
  <div class='field'>
    <input onChange={(e) => setUsername(e.target.value)} value={username} type="text" name="username" placeholder="Username" />
    {errors.username && <div>{errors.username}</div>}
  </div>
  <div class='field'>
    <input onChange={(e) => setPassword(e.target.value)} value={password} type="password" name="password" placeholder="Password" />
    {errors.password && <div>{errors.password}</div>}
  </div>
  <div class='field'>
    <input onChange={(e) => setEmail(e.target.value)} value={email} type="text" name="email" placeholder="E-mail" />
    {errors.email && <div>{errors.email}</div>}
  </div>
  <div class='field'>
    <input onChange={(e) => setPhone(e.target.value)} value={phone} type="text" name="phone" placeholder="Phone #" />
    {errors.phone && <div>{errors.phone}</div>}
  </div>
  <div class='field'>
    <input onChange={(e) => setAge(e.target.value)} value={age} type="number" min="5" name="age" placeholder="Age" />
{errors.age && <div>{errors.age}</div>}

  </div>
  <button class='fluid ui button' type="submit">Submit</button>
</form>






